import "./App.css";
import UmlItem from "./UmlItem";
function Umls(props) {




    return (

            <div>


                <div className="InputUml">
                    <label>OriginalUml: </label>
                    {props.items.map((umllist)=> (<UmlItem uml={umllist.umlData}/>))}
                    {props.items[0].olduml}

                </div>
            </div>

    )
        ;
}

export default Umls;
